const styles = (theme) => ({
  stepper: {
    width: `calc(100% + ${theme.spacing(2)}px) !important`,
    marginTop: theme.spacing(-2),
    marginLeft: theme.spacing(-1),
    marginRight: theme.spacing(-1),
    marginBottom: theme.spacing(8),
  },
});

export default styles;
